import './App.css';

import TitleBar from './components/TitleBar/TitleBar';
import SearchField from './components/UrlInput/UrlInput';
import SubHeader from './components/SubHeader/SubHeader';
import Summary from './components/Summary/Summary';

function App() {
  return (
    <div className='App'>
      <TitleBar />
      <div className='container'>
        <SearchField />
        <div className='pane-wrapper'>
          <div className='left-pane'>
            <SubHeader title='Transcript Summary' customComponent={<Summary text="this is a summary" />}/>
          </div>
          <div className='right-pane'>
            <SubHeader title='The Actual Transcript'/>
            <SubHeader title='Ask Questions about the Video'/>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
